import React from 'react'
import { StyleSheet, Text, View } from 'react-native'

const CategoriesScreen = () => {
    return (
        <View>
            <Text>Categories</Text>
        </View>
    )
}

export default CategoriesScreen

const styles = StyleSheet.create({
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center'
})
